RE: Chicago Public Schools FOIA Request N014778-020424 Dear Miriam: Thank you again for using the Chicago Public Schools FOIA Center. Under the Freedom of Information Act, a public body may extend the time to respond to a FOIA request by up to 5 business days for a limited number of reasons. 5 ILCS 140/3(e). We are extending the time to respond to your request by 5 business days for one or more of the following reason(s): (  ) the requested records are stored in whole or in part at other locations than the office having charge of the requested records; 
( )  the request requires the collection of a substantial number of specified records; 
( ) the request is couched in categorical terms and requires an extensive search for the records responsive to it; 
( ) the requested records have not been located in the course of routine search and additional efforts are being made to locate them; 
(x) the requested records require examination and evaluation by personnel having the necessary competence and discretion to determine if they are exempt from disclosure under Section 7 of this Act or should be revealed only with appropriate deletions; 
(x) the request for records cannot be complied with by the public body within the time limits prescribed by 5 ILCS 140/3 (c) without unduly burdening or interfering with the operations of the public body; 
( ) there is need for consultation, which shall be conducted with all practicable speed, with another public body or among two or more components of a public body having a substantial interest in the determination or in the subject matter of the request. Sincerely, 
Patricia Majchrowicz Freedom of Information Act Officer Chicago Public Schools Please note that District Offices will be closed on  Monday, February 19th in observance of Presidents Day.

To Whom It May Concern:

Pursuant to the Oregon Public Records Law, I hereby request the following records:

1. any requests for proposals, proposals submitted by vendors, contracts, budgets or cost allocations for the purchase and/or use of aerial drones, UAs, UAVs, and UASs (hereinafter “drones”) and any related software e.g. flight planning software or mission planning software;

2. any policies, guidelines, manuals and/or instructions on department use of drones, including on the legal process required (such as a warrant or court order), if any, before operating a drone;

3. an inventory of any and all drones or drone related software purchased and currently or previously in use including manufacturer, model, hardware and software versions;

4. a list of all FAA part 107 licenses and waivers applied for, granted, and denied including:

a. Beyond Line of Sight (BVLOS) waivers;

b. Advanced Operations certifications or waivers;

c. Part 137 approvals or waivers;

d. section 44807 exemptions;

5. any departmental records concerning this department’s use of drones now or plans to use drones in the future including:

a. the types of investigations or instances in which this department is using or plans to use drones, or how it plans to support, manage or oversee the usage of drones by another department or office;

b. policies, guidelines, manuals and/or instructions on storage requirements or procedures for video or static images obtained through use of drones, including retention times;

c. the altitude at which drones can or do fly;

d. drones’ ability to carry any type of payload e.g. weapons or sensor packages

The requested documents will be made available to the general public, and this request is not being made for commercial purposes.

In the event that there are fees, I would be grateful if you would inform me of the total charges in advance of fulfilling my request. I would prefer the request filled electronically, by e-mail attachment if available or CD-ROM if not.

Thank you in advance for your anticipated cooperation in this matter. I look forward to receiving your response to this request within 10 business days.

Sincerely,

Chris Martin

